CREATE DATABASE IF NOT EXISTS faa_database

USE faa_database

create table Aircraft
(
    Manufacturer                  varchar(64) null,
    Model                         varchar(64) null,
    Relevant                      tinyint(1)  null,
    EngineType                    varchar(16) null,
    EngineNumber                  int         null,
    AircraftApproachCategory      char        null,
    AirplaneDesignGroup           varchar(2)  null,
    TaxiwaysDesignGroup           varchar(2)  null,
    ApproachSpeedMetersPerSecond  double      null,
    ApproachSpeedKts              double      null,
    WingtipConfig                 varchar(16) null,
    WingspanMeters                double      null,
    WingspanFeet                  double      null,
    LengthMeters                  double      null,
    LengthFeet                    double      null,
    TailHeightMeters              double      null,
    TailHeightFeet                double      null,
    WheelbaseMeters               double      null,
    WheelbaseFeet                 double      null,
    CockpitToMainGearMeters       double      null,
    CockpitToMainGearFeet         double      null,
    MainGearWidthMeters           double      null,
    MainGearWidthFeet             double      null,
    MaximumTakeOffWeightKilograms double      null,
    MaximumTakeOffWeightPounds    double      null,
    MaxRampWeightKilograms        double      null,
    MaxRampWeightPounds           double      null,
    MainGearConfig                varchar(8)  null,
    ICAOCode                      varchar(5)  null,
    WakeCategory                  varchar(3)  null,
    ParkingAreaSquareMeters       double      null,
    ParkingAreaSquareFeet         double      null
);

